/**
 * @name ImageFollowMouse
 * @author Vladyna
 * @description Image follows mouse
 * @version 0.0.1
 */

const image = "data:image/gif;base64,";
const imageIdleForTooLong = "data:image/webp;base64,";
var idleTimeLimit = 2000;
var hasIdleFired = false;
module.exports = class CursorImagePlugin {

    constructor(meta) {
        this.mouseX = 0;
        this.mouseY = 0;
        this.currentX = 0;
        this.currentY = 0;
        this.followDistance = 60;
    }

    start() {

        BdApi.DOM.addStyle(`
            .cursor-image {
                position: fixed;
                pointer-events: none;
                width: 100px;
                height: 100px;
                z-index: 99999;
                transform: translate(-50%, -50%);
                background-color: transparent;
                display: block;
            }
        `);


        this.cursorImage = document.createElement("img");
        this.cursorImage.src = image;
        this.cursorImage.alt = "Cursor Follow Image";
        this.cursorImage.className = "cursor-image";
        this.cursorImage.style = "position: fixed !important; pointer-events: none !important;width: 50px !important;height: 50px !important;  z-index: 99999 !important; transform: translate(-50%, -50%) !important; display: block !important; visibility: visible !important; background-color: transparent;";
        document.body.appendChild(this.cursorImage);
        var timer;
        this.mouseMoveHandler = (e) => {

            if (timer != null) {
                clearTimeout(timer);
            }
            if (this.isIdle) {
                this.onIdle(false);
                this.isIdle = false;
            }
            this.mouseX = e.clientX;
            this.mouseY = e.clientY;

            if (!hasIdleFired) {
                timer = setTimeout(() => {
                    this.isIdle = true;
                    this.onIdle(true);
                }, idleTimeLimit);
            }

        };
        this.interval = setInterval(() => this.updateImagePosition(), 16);
        document.addEventListener("mousemove", this.mouseMoveHandler);

        BdApi.UI.showToast("Cursor Image Plugin Started!");
    }

    stop() {

        if (this.cursorImage) {
            this.cursorImage.remove();
        }
        if (this.interval) {
            clearInterval(this.interval);

        }

        document.removeEventListener("mousemove", this.mouseMoveHandler);

        BdApi.UI.showToast("Cursor Image Plugin Stopped!");
    }

    updateImagePosition(cursorImage) {

        var xDistance = this.mouseX - this.currentX;
        var yDistance = this.mouseY - this.currentY;
        var xNormalizedDir = xDistance / Math.abs(xDistance);
        var yNormalizedDir = yDistance / Math.abs(yDistance);
        var distanceToFollowX = (Math.abs(xDistance) - this.followDistance / 2);
        distanceToFollowX = distanceToFollowX < 0 ? 0 : distanceToFollowX;
        var distanceToFollowY = (Math.abs(yDistance) - this.followDistance / 2)
        distanceToFollowY = distanceToFollowY < 0 ? 0 : distanceToFollowY;
        this.currentX += distanceToFollowX * xNormalizedDir * 0.1;
        this.currentY += distanceToFollowY * yNormalizedDir * 0.1;
        this.cursorImage.style.left = `${this.currentX}px`;
        this.cursorImage.style.top = `${this.currentY}px`;
    }

    onIdle(isIdle) {
        this.cursorImage.src = isIdle ? imageIdleForTooLong : image;
        if (isIdle) {
            BdApi.UI.showToast("JOHN PORK IS CALLING, PICK UP!");
        }
    }
};